import React from 'react';

const Header = function() {
  return ( 
    <div className="Header"> 
        <a href="#s">
          css
        </a>
        <a>
          html
        </a>
        <a>
          js
        </a>
        <a>
          react
        </a>
    </div> 
  );
}

export default Header;
